"""##Updating the neural network
As can be seen from the graph above, the learning curves graph is not so good.<br>
The validation loss fluctuate a lot and does not seem to converge.

So I added to my neural network 2 dropout layers.<br>
Dropout is a regularization technique that randomly sets a fraction (in this case, 50%) of the input units to 0 at each update during training time, which helps prevent overfitting. During testing and validation dropout is turned off.<br>

Because dropout is not applied during validation, the network's performance on the validation set may initially appear better than on the training set. However, the impact of dropout during training should generally lead to better generalization, meaning the validation loss should be lower and more stable over time compared to a network without dropout.
"""

import torch.nn as nn
import torch.nn.functional as F

class SimpleClassifier(nn.Module):
    def __init__(self):
        super(SimpleClassifier, self).__init__()
        self.fc1 = nn.Linear(7 * 7 * 512, 512)    #fully connected layer that takes an input of size 7 * 7 * 512 and outputs 512 features.
        self.dropout1 = nn.Dropout(0.5)           #dropout
        self.fc2 = nn.Linear(512, 128)            #fully connected layer that takes 512 features as input and outputs 128 features.
        self.dropout2 = nn.Dropout(0.5)           #dropout
        self.fc3 = nn.Linear(128, 1)              #fully connected layer that takes 128 features and outputs a single value, used for binary classification.

    def forward(self, x):
        x = x.view(x.size(0), -1)                 # Flattens the input tensor except for the batch dimension. If x is of shape (batch_size, 7, 7, 512), it will be reshaped to (batch_size, 7 * 7 * 512).
        x = F.relu(self.fc1(x))                   # relu activation to the first layer
        x = self.dropout1(x)                      #dropout
        x = F.relu(self.fc2(x))                   #relu activation to the second layer
        x = self.dropout2(x)                      #dropout
        x = torch.sigmoid(self.fc3(x))            #sigmoid activation function to the output of the final layer, producing a value between 0 and 1, for binary classification
        return x

"""## Train and validate function"""

import matplotlib.pyplot as plt
from sklearn.metrics import accuracy_score

def train_and_validate(model, train_loader, val_loader, criterion, optimizer, epochs=20):
    train_losses, val_losses = [], []
    train_accuracies, val_accuracies = [], []

    for epoch in range(epochs):
        # Training phase
        model.train()
        train_loss = 0.0
        train_correct = 0
        for features, labels in train_loader:
            optimizer.zero_grad()
            outputs = model(features)
            loss = criterion(outputs.squeeze(), labels)
            loss.backward()
            optimizer.step()
            train_loss += loss.item()
            preds = (outputs.squeeze() > 0.5).float()
            train_correct += (preds == labels).sum().item()

        train_loss /= len(train_loader)
        train_accuracy = train_correct / len(train_loader.dataset)
        train_losses.append(train_loss)
        train_accuracies.append(train_accuracy)

        # Validation phase
        model.eval()
        val_loss = 0.0
        val_correct = 0
        with torch.no_grad():
            for features, labels in val_loader:
                outputs = model(features)
                loss = criterion(outputs.squeeze(), labels)
                val_loss += loss.item()
                preds = (outputs.squeeze() > 0.5).float()
                val_correct += (preds == labels).sum().item()

        val_loss /= len(val_loader)
        val_accuracy = val_correct / len(val_loader.dataset)
        val_losses.append(val_loss)
        val_accuracies.append(val_accuracy)

        print(f"Epoch {epoch+1}/{epochs}, "
              f"Train Loss: {train_loss:.4f}, Train Accuracy: {train_accuracy:.4f}, "
              f"Val Loss: {val_loss:.4f}, Val Accuracy: {val_accuracy:.4f}")

    # Plotting learning curves
    plt.figure(figsize=(12, 4))
    plt.subplot(1, 2, 1)
    plt.plot(train_losses, label='Train Loss')
    plt.plot(val_losses, label='Validation Loss')
    plt.xlabel('Epoch')
    plt.ylabel('Loss')
    plt.legend()
    plt.title('Loss vs. Epoch')

    plt.subplot(1, 2, 2)
    plt.plot(train_accuracies, label='Train Accuracy')
    plt.plot(val_accuracies, label='Validation Accuracy')
    plt.xlabel('Epoch')
    plt.ylabel('Accuracy')
    plt.legend()
    plt.title('Accuracy vs. Epoch')

    plt.show()

    return train_losses, val_losses, train_accuracies, val_accuracies

"""##train with best hyperparameters function
I will not change criterion and optimizer to make the comparison with the last model more effective.<br>
I will just choose the better epochs based on the learning curves as one of the problems of the last model could also be the too many epochs.<br>I will also use the same exact learning rate, pinned to 0.001
"""

def train_with_best_hyperparameters(model, train_loader, val_loader, best_hyperparams):
    criterion = best_hyperparams['criterion']
    optimizer = best_hyperparams['optimizer']
    epochs = best_hyperparams['epochs']

    train_and_validate(model, train_loader, val_loader, criterion, optimizer, epochs)

